import React from "react";
import { Link } from "react-router-dom";

function Homepage () {
    return(
        <div className="homenav">
            <nav className="nav">
                <a href= '/'></a>
                <Link to="/dashboard">Dashboard</Link>
                <Link to="/registerpage">Sign Up</Link>
                <Link to="/login">Login</Link>
            </nav>
        </div>
    )
}

export default Homepage;
